import React from "react";
import { AppBar, Container, Typography, Grow, Grid } from "@material-ui/core";

const App = () => {
  return (
    <Container maxWidth="lg">
      <AppBar position="static" color="inherit">
        <Typography variant="h2" align="center">
          Memories
        </Typography>
      </AppBar>
    </Container>
  );
};

export default App;
